// src/App.js
import React from 'react';
import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';
import Dashboard from './components/Dashboard';  // Ensure this path matches the location of Dashboard.js
import ManageAdmin from './components/ManageAdmin';  // Example of another page
import ManageHome from './components/home_page';  // Example of another page

const App = () => {
  return (
    <Router>
      <Routes>
        {/* Main Dashboard Route */}
        <Route path="/" element={<Dashboard />} />

        {/* Additional routes */}
        <Route path="/manage-admin" element={<ManageAdmin />} />
        <Route path="/manage-home" element={<ManageHome />} />
      </Routes>
    </Router>
  );
};

export default App;
